import { apiMethods, apiEndpoints } from './api';

export const authService = {
  login: async (email, password) => {
    return await apiMethods.post(apiEndpoints.auth.login, { email, password });
  },
  
  register: async (userData) => {
    return await apiMethods.post(apiEndpoints.auth.register, userData);
  },
  
  logout: async () => {
    return await apiMethods.post(apiEndpoints.auth.logout);
  },
  
  getCurrentUser: async () => {
    return await apiMethods.get(apiEndpoints.auth.me);
  }
};
